import logo from './logo.svg';
import codecademyLogo from './codecademy-logo.png'
import { getValue } from '@testing-library/user-event/dist/utils';

//variable
let characteristics = ["Weapon Skill (WS)", "Ballistic Skill (BS)", "Strength (S)", "Toughness (T)", "Agility (Ag)", "Intelligence (Int)", "Perception (Per)", "Willpower (WP)", "Fellowship (Fel)"] ;
let characteristicsValues = [46, 44, 60, 50, 34, 53, 41, 38, 37]
let characteristicsAdvToken = ["[*][*][][]", "[*][*][][]", "[*][*][][]", "[*][*][][]", "[*][][][]", "[*][*][*][]", "[][][][]", "[][][][]", "[][][][]"]

//Function HTML section
function Content01() {
  return (
      <div 
        id="startSection01"
        className="Main-Content" 
        style={{fontWeight:"500", height:"100vh"}}
        data-aos="fade-right"
        data-aos-anchor-placement="top-center"
        data-aos-duration="1000"
        // data-aos-offset="0"
      >
        <h1>Characteristics</h1>
            <p><span className='characteristicsName'><label>{characteristics[0]}</label></span><span className='characteristicsValue'> - {characteristicsValues[0]}</span>{`br`}<span className='characteristicsAdvToken'>{characteristicsAdvToken[0]}</span></p>
      </div>
  );
}

export default Content01;
